import MenuBar from '../Home/MenuBar';
import ButtonCard from '../Home/ButtonCard';
import { GiPayMoney } from 'react-icons/fa';

function HomePage() {
  return (
    <div className="bg-gradient-to-b from-gray-100 to-gray-200 min-h-screen">
      <div className="fixed inset-0 bg-noise"></div>
      <MenuBar />
      <div className="container mx-auto mt-8">
        <div className="grid grid-cols-2 gap-4">
        <ButtonCard title="Account" icon="user" />
        <ButtonCard title="Loan" icon="money" />
        <ButtonCard title="Credit Card" icon="creditCard" />
        <ButtonCard title="Bills" icon="bills" />
        <ButtonCard title="Transfers" icon="transfers" />
        <ButtonCard title="Contact Us" icon="contact" />
        </div>
      </div>
    </div>
  );
}

export default HomePage;
